import React from 'react';
import { useRef } from 'react';

const Header = () => {
  const burgerMenuRef = useRef(null);
  const overlayRef = useRef(null);

  const handleBurgerMenuClick = () => {
    burgerMenuRef.current.classList.toggle("close");
    overlayRef.current.classList.toggle("overlay");
  };

  return (
    <div>
      <div className="header py-[0.5em] bg-[#FFFFFF] text-black relative text-[20px]">

        <div className="icons pl-[5vw]">
          <a href='/' className=''><img src='./images/logo.png' className='h-[3em] aspect-asquare'></img></a>
        </div>

        <div id="burger-menu" ref={burgerMenuRef} className="md:hidden" onClick={handleBurgerMenuClick}>
          <span className="light-span"></span>
        </div>

        <div id="menu" ref={overlayRef}>
          <ul className="text-[white] px-[10vw] pt-[18vh] text-[48px] text-left">
            <li><a href="/team">Team</a></li>
            <li><a href="/events">Events</a></li>
            <li><a href="/history">History</a></li>
            <li><a href="/sponsors">Sponsors</a></li>
            <li className='text-primary'><a href="/contact">Contact</a></li>
          </ul>
        </div>

        <ul className="headerlist hidden md:flex gap-[3vw] pr-[5vw] font-[500] text-[18px] lg:text-[20px]">
          <li className='flexCol underline-animation'><a href="/Team">Team</a></li> 
          <li className='flexCol underline-animation'><a href="/events">Events</a></li> 
          <li className='flexCol underline-animation'><a href="/history">History</a></li> 
          <li className='flexCol underline-animation'><a href="/sponsors">Sponsors</a></li> 
          <li className=''><a className='btn py-[0.2em]' href='/contact'>Connect</a></li>
        </ul>

      </div>
    </div>
  )
}

export default Header;
